import { Bread } from './Bread';
import { MainNav } from './MainNav';
import { MainSection1 } from './MainSection1';
import { MainSection2 } from './MainSection2';
import { MainSection3 } from './MainSection3';
import { MainSection4 } from './MainSection4';
import { MainSection5 } from './MainSection5';
import section1Styles from './style/MainSection1.module.css';
import section2Styles from './style/MainSection2.module.css';
import section3Styles from './style/MainSection3.module.css';
import section4Styles from './style/MainSection4.module.css';
import section5Styles from './style/MainSection5.module.css';

export function MainContent({ mainsection }) {
  const getSectionComponent = () => {
    switch (mainsection) {
      case 1:
        return { Component: MainSection1, style: section1Styles.mainSection1 };
      case 2:
        return { Component: MainSection2, style: section2Styles.mainSection2 };
      case 3:
        return { Component: MainSection3, style: section3Styles.mainSection3 };
      case 4:
        return { Component: MainSection4, style: section4Styles.mainSection4 };
      case 5:
        return { Component: MainSection5, style: section5Styles.mainSection5 };
      default:
        return { Component: () => null, style: '' };
    }
  };

  const { Component, style } = getSectionComponent();

  return (
    <div className={`main-content ${style}`}>
      <MainNav />
      <Bread />
      <Component />
    </div>
  );
}
